import '../App.css';
import ReservoirData from './ReservoirData';
import reservoirIDs from '../constants/reservoirIDs';
import axios from 'axios';
import React, { useState, useEffect } from 'react';

function Main() {

    const [data, setData] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        axios.get('/dynamicapp/req/JSONDataServlet?Stations=EXC&SensorNums=15&dur_code=D&Start=2023-07-24&End=2023-08-24')
            .then(response => {
                setData(response.data);
                console.log(setData)
            })
            .catch(error => {
                setError(error);
                setLoading(false);
            })
    })

    if (loading) {
        return <p>Loading...</p>;
    }

    if (error) {
        return <p>Error: {error.message}</p>;
    }

    return (
        <div>
            <h1>API Response:</h1>
            <ul>
                {data.map(item => (
                    <li key={item.id}>{item.title}</li>
                ))}
            </ul>
        </div>
    );

    const resCards = reservoirIDs.map((res) => {
        return (
            <ReservoirData name={res.name} id={res.id} />
        )
    }
    )

    const clickHandler = () => {
        console.log("clicked!");
    }

    return (
        <div className="App">
            <div className="App-background">
                <button onClick={clickHandler}>Click me!</button>
                {resCards}
            </div>
        </div >
    );
}

export default Main;
